import React from 'react'
import './ratings.css'
import {Grid} from "@mui/material";
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';

function Ratings(props){
    return(
        <div className="ratings">
            <Box>
                <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }} className="ratings-wrapper">
                    <Grid>
                        <Item>
                            <img  className="ratings-image" src={props?.professor?.img}/>
                            <h4 className="ratings-info">{props?.professor?.name}</h4>
                        </Item>
                    </Grid>
                </Grid>
            </Box>
        </div>
    )
}
export default Ratings
